/**
 * カードデータ作成クラス.
 */
function CCardDataMaker () {

}

//================================================================
// カードデータ定義用ダミー関数
// （可読性を高める目的で使用する）
//================================================================
CCardDataMaker.CardKind = function (value) { return value; };
CCardDataMaker.CardName = function (value) { return value; };
CCardDataMaker.CardDetailText = function (value) { return value; };

/**
 * IDを定義する.
 * @param name 定数名
 * @param value 定数値
 * @return 定数値
 */
CCardDataMaker.RegisterId = function (name, value) {
	if (name != "CARD_ID_UNKNOWN") {
		CGlobalConstManager.DefineEnum("EnumCardId", [name], value, 0);
	}
	return value;
};





